  \"Data on streamflow and quality of water and bottom sediment in and near Humboldt
  Wildlife Management Area, Churchill and Pershing Counties, Nevada, 1998-2000\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 7,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:35.572468\",\n\t\"name\": \"data-on-streamflow-and-quality-of-water-and-bottom-sediment-in-and-near-humboldt-wild-1998\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was initiated to expand upon
  previous findings that indicated concentrations of dissolved solids, arsenic, boron,
  mercury, molybdenum, selenium, and uranium were either above geochemical background
  concentrations or were approaching or exceeding ecological criteria in the lower
  Humboldt River system. Data were collected from May 1998 to September 2000 to further
  characterize streamflow and surface-water and bottom-sediment quality in the lower
  Humboldt River, selected agricultural drains. Upper Humboldt Lake, and Lower Humboldt
  Drain (ephemeral outflow from Humboldt Sink). During this study, flow in the lower
  Humboldt River was either at or above average. Flows in Army and Toulon Drains generally
  were higher than reported in previous investigations. An unnamed agricultural drain
  contributed a small amount to the flow measured in Army Drain. In general, measured
  concentrations of sodium, chloride, dissolved solids, arsenic, boron, molybdenum,
  and uranium were higher in water from agricultural drains than in Humboldt River
  water during this study. Mercury concentrations in water samples collected during
  the study period typically were below the laboratory reporting level. Although water
  supplies from the agricultural drains typically contained higher concentrations
  of sodium, chloride, dissolved solids, arsenic, boron, and uranium, greater instantaneous
  loads of these constituents were carried in the river near Lovelock than in agricultural
  drains during periods of high flow or non-irrigation. Nickel concentrations in sediments
  collected during this study were above the consensus-based threshold-effect concentration.
  All other river and drain sediments had constituent concentrations below protective
  criteria and toxicity thresholds. In Upper Humboldt Lake, chloride, dissolved solids,
  arsenic, boron, molybdenum, and uranium concentrations in surface-water samples
  collected near the mouth of the Humboldt River generally were higher than in samples
  collected near the mouth of Army Drain. Ecological criteria of effect concentrations
  for chloride, arsenic, boron, molybdenum, and selenium were exceeded in samples
  collected near the mouths of the Humboldt River and Army Drain. Bottom sediments
  collected from Upper Humboldt Lake had arsenic, cadmium, chromium, copper, and nickel
  concentrations that either approached or exceeded biological-effect concentrations
  and/or Canadian Interim Freshwater Sediment-Quality Guidelines. All other wetland
  sediments collected during this study had constituent concentrations within acceptable
  limits.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
